        <h1><strong>Are You Following the 30/30 Approach?</strong></h1>
        <p>
        Studies have shown that flies can cause serious economic damage to dairy operations. House, stable, face and horn flies are all known to spread disease, interfere with weight gain and hinder milk production, hurting your bottom line. By following a “30/30” approach through the fall, producers can get ahead of the spring fly emergence before it builds to a level that exceeds the economic threshold.</p>
        <p>
        Learn how to get started with a 30/30 program and boost your fly control efforts in our video below.
        </p>
